import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";

const Dashboard = () => {
  const [userData, setUserData] = useState<any>(null);
  const [bookings, setBookings] = useState<any[]>([]);
  const [error, setError] = useState<string | null>(null);
  const [selectedRoom, setSelectedRoom] = useState<number | null>(null); // Для вибору кімнати для бронювання
  const [checkIn, setCheckIn] = useState<string>(""); // Дата заїзду
  const [checkOut, setCheckOut] = useState<string>(""); // Дата виїзду
  const navigate = useNavigate();

  useEffect(() => {
    const token = localStorage.getItem("token");
    if (!token) {
      navigate("/login");
      return;
    }

    // Отримуємо інформацію про користувача
    fetch("http://localhost:5000/user", {
      headers: {
        Authorization: `Bearer ${token}`,
      },
    })
      .then((response) => response.json())
      .then((data) => setUserData(data))
      .catch((err) => {
        setError("Помилка при отриманні даних користувача");
        console.error(err);
      });

    // Отримуємо бронювання користувача
    fetch("http://localhost:5000/user/bookings", {
      headers: {
        Authorization: `Bearer ${token}`,
      },
    })
      .then((response) => response.json())
      .then((data) => setBookings(data))
      .catch((err) => {
        setError("Помилка при отриманні бронювань");
        console.error(err);
      });
  }, [navigate]);

  // Бронювання номера
  const handleBooking = async () => {
    if (!selectedRoom || !checkIn || !checkOut) {
      setError("Будь ласка, заповніть всі поля.");
      return;
    }

    const token = localStorage.getItem("token");
    if (!token) return;

    try {
      const response = await fetch("http://localhost:5000/user/bookings", {
        method: "POST",
        headers: {
          Authorization: `Bearer ${token}`,
          "Content-Type": "application/json",
        },
        body: JSON.stringify({ roomId: selectedRoom, checkIn, checkOut }),
      });

      if (response.ok) {
        const newBooking = await response.json();
        setBookings([...bookings, newBooking]);
      } else {
        setError("Не вдалося забронювати номер.");
      }
    } catch (err) {
      setError("Помилка при бронюванні.");
      console.error(err);
    }
  };

  // Скасування бронювання
  const handleCancelBooking = async (bookingId: string) => {
    const token = localStorage.getItem("token");
    if (!token) return;

    try {
      const response = await fetch(
        `http://localhost:5000/user/bookings/${bookingId}`,
        {
          method: "DELETE",
          headers: {
            Authorization: `Bearer ${token}`,
          },
        }
      );

      if (response.ok) {
        setBookings(bookings.filter((booking) => booking.id !== bookingId));
      } else {
        setError("Не вдалося скасувати бронювання");
      }
    } catch (err) {
      setError("Помилка при скасуванні бронювання");
      console.error(err);
    }
  };

  return (
    <div>
      <h1>Особистий кабінет</h1>
      {userData && (
        <div>
          <p>Ім'я: {userData.username}</p>
          <p>Email: {userData.email}</p>
        </div>
      )}
      {error && <p style={{ color: "red" }}>{error}</p>}
      <h2>Ваші бронювання</h2>
      <ul>
        {bookings.map((booking) => (
          <li key={booking.id}>
            <p>Номер: {booking.roomName}</p>
            <p>Дата заїзду: {booking.checkIn}</p>
            <p>Дата виїзду: {booking.checkOut}</p>
            <button onClick={() => handleCancelBooking(booking.id)}>
              Скасувати бронювання
            </button>
          </li>
        ))}
      </ul>

      <h2>Забронювати номер</h2>
      <input
        type="number"
        placeholder="ID кімнати"
        onChange={(e) => setSelectedRoom(Number(e.target.value))}
      />
      <input
        type="date"
        value={checkIn}
        onChange={(e) => setCheckIn(e.target.value)}
      />
      <input
        type="date"
        value={checkOut}
        onChange={(e) => setCheckOut(e.target.value)}
      />
      <button onClick={handleBooking}>Забронювати</button>
    </div>
  );
};

export default Dashboard;
